import '../styles/Navbar.css';

function Navbar() {
  return (
    <div className="navbar">
        <a href="#">4-3-3</a>
        <a>Home</a>
        <a>Matches</a>
        <a>Host a Match</a>
    </div>
  );
}

export default Navbar;
